function parseTitle (t) {
  //t = "homonuculus_has_left_the_buildingAt"
  if (!noThe.includes(t))
  t = "THE "+t
  t = t.replace(/_RE_/gi, "'RE_")
  t = t.replace(/TROPE/gi, "TROPE:")
  t = t.replace(/At/g, "").toUpperCase()
  t = t.replace(/\c/g, ",")
  t = t.replace(/_/g, " ")
  
  console.log(t)
  return t.split(" ")
}

